css:
@-moz-document domain("neogaf.com") {
.thead, .tfoot {
background-color: #E2BB0D !important;
border-color: #E8D161 !important;
color: #ffffff !important;

}

.forum-tabs.bot {
border-color: #E2BB0D !important;
}

.large-button { 
background-color: #E2BB0D !important;
}

#main, #footer, .goodie728 {
background-color: #E8D161 !important;
}

#header
{
background-color: #DDBE30 !important;
  
}

.tcat, #threadsearch.wmenu, #forumsearch.wmenu, .pagenav > li.current > span {
background: #E2BB0D !important;
border-color: #E8D161 !important;
  color: #FFFFFF;
}

.pagenav > li.current > span {
background: #E2BB0D !important;
}

#toolbar {
background-color: #E8D161 !important;
}

.forum-tabs > li > a {
display: block;
line-height: 23px;
font-weight: 700;
font-size: 12px;
color: #FFFFFF;
background-color: #DDBE30;
border-radius: 3px 3px 0 0;
padding: 0 12px;
position: static;
}

.forum-tabs > li.activetab > a {
				background-color: #E2BB0D !important;
				z-index: 2;
				line-height: 24px;
			}

.forum-tabs > li > a {
color: #FFFFFF;
background-color: #E5C94B;
}

.forum-tabs > li > a:hover {
background-color: #D3B945;
}

    .forum-tabs > li > a:hover, .forum-tabs > li.child > a:hover {
color: #fff;
background-color: #D3B945;
}
    
.panelsurround {
background-color: #CCAC2C !important;
}

.panel {
background-color: #CCAC2C !important;
border-color: #E8D161 !important;
}


.alt1, .alt1Active, .alt2, .alt2Active {
background: #DBBB30 !important;
border-color: #E8D161 !important;
color: #FFFFFF !important;
}

.alt2 {
background: #CCAC2C!important;
border-color: #E8D161 !important;
}

.quote {
background: #EDCA3D !important;
border-color: #F9DF75 !important;

}

.postbit-details, .threadbit > td {
border-color: #E8D161 !important;
color: #FFFFFF !important;
}


#splash {
color: #FFFFFF !important;
}

#forum-list {
background-color: #C9AB28 !important;
}

#forum-extras {
background-color: #D1B236 !important;
color:  #FFFFFF !important;
}

.goodie300 {
background-color: #E8D161 !important;
}

.forum-bit-lastpost {
border-left: 1px solid #ffffff !important;
}

[class^="forumextraicon-"], .forum-info > .forumicon {
background-color: #E8D161 !important;

}


.spoiler {
color: #000000 !important;
background: #000000 !important;

}

.spoiler.show {
color: #ffffff !important;
background: #000000 !important;

}

a:link, a:active {
color: #FFFFFF !important;
}

a:hover {
color: #FFFFFF !important;
}

a:visited {
color:#FFFFFF !important;
}

#links a:hover {
color: #FFFFFF !important;
}

.post-meta-border, .mypost blockquote.quote {
border-color: #F9DF75 !important;
}

.vBulletin_editor {
	background: #FFFFFF;
	padding: 8px;
}


html, body {
color: #FFFFFF  !important;
background-color: #E8D161 !important;
}

.forum-stats-bits > li > var {
display: block;
text-align: center;
font-style: normal;
font-size: 20px;
line-height: 32px;
color: #FFFFFF;
}

.stats-whatsgoingon h4 {
font-size: 20px;
line-height: 32px;
margin: 0;
color: #FFFFFF;
}

.vbmenu_control {
background: #DDBE30;
color: #FFFFFF;
font-weight: bold;
padding: 4px 8px;
white-space: nowrap;
}

.mypost, .mypost .postbit-post, .mypost .postbit-details{
background-color:#DBAF00 !important; 
border-color: #E8D161 !important;
}
.mypost blockquote.quote{
border-color: #E8D161 !important; 
}

.footer-links {
color: #AD8801;
border-top: 1px solid #E5C33D;  
}

.newreplybox p {
color: #FFFFFF !important ;
margin: 0 0 3px;
text-align: center;
}

.qbutton {
margin: 0 2px 3px;
background-color: #5B5656 !important;
border: 0;
font-size: 11px;
color: #FFFFFF !important;
padding: 3px 4px;
border-radius:3px;
}

.qbutton:focus, .qbutton:hover {
outline: none;
-moz-border-radius: 3px;
border-radius: 3px;
background-color: #4F4B4B !important ;
border: 0;
color: #FFFFFF !important ;
}

#forum-list {
color: #FFFFFF;
}


#logo, body.forumhome #logo {
  background-position:center;
  background-size: cover;
  background-image: url(data:image/png;base64,);
}


.vbmenu_option {
background-color: #DDBE30;
color: #FFFFFF;
}

.stats-whatsgoingon-icon {
background-color: #FCE88D;
}

.thread-prefix {
background-color: #FCD847;
color: #888;
}

.alt1 .postbit-details, .alt1 .postbit-post, .alt1 .post-meta-border, .alt1 blockquote.quote {
border-color: #E8D161;
}

.alt2 .postbit-details, .alt2 .postbit-post, .alt2 .post-meta-border, .alt2 blockquote.quote {
border-color: #E8D161;
}

.vBulletin_editor {
border: 1px solid #1e1e1e !important;
background-color: #DBBB30 !important;
}

.bginput, input[type="text"], input[type="password"], textarea {
border: 1px solid #EAC84D;
background-color: #E5C33D;
color: #FFFFFF;
}

.time {
color: #C49A01;
}
}
